import '../css/Navbar.css';

function Navbar() {
  return (
    <>
      <nav>
          <div class="logo-and-name-div">
              <div class="logo-circle col-4">
                  <span>BC</span>
              </div>
              <span class="logo-and-name">BEN CRUISE | FRONT END DEVELOPER</span>
          </div>
          <div class="links-div col-6">
              <div class="select-option" data-name="home">HOME</div>
              <div class="select-option" data-name="about">ABOUT</div>
              <div class="select-option" data-name="work">WORK</div>
              <div class="select-option" data-name="contact">CONTACT</div>            
          </div>
          <i class="fa fa-bars fa-lg" id="toggle-fa"></i>
      </nav>
    </>    
  );
}

export default Navbar;
